h2 class=\"servicos-title\">Fábrica de Software</h2>\r\n		<p class=\"servicos-para\">Softwares sob medida para o seu negócio. Ganhe tempo e flexibilidade para construção de ferramentas personalizadas</p>\r\n	</div>\r\n	<div class=\"col-xs-12 col-sm-12 col-md-4 col-lg-4 wrapper-overlay\">\r\n		<div class=\"overlay\"><span class=\"fa fa-plus\"></span></div>\r\n		<div class=\"servicos-icon\"><i class=\"fa fa-html5\"></i></div>\r\n		<h2 class=\"servicos-title\">Desenvolvimento Web</h2>\r\n		<p class=\"servicos-para\">Sistemas Web On Demand. Desenvolvimento de ferramentas, portais, blogs e tudo que sua empresa precisa para alavancar na internet</p>\r\n	</div>\r\n	<div class=\"col-xs-12 col-sm-12 col-md-4 col-lg-4 wrapper-overlay\">\r\n		<div class=\"overlay\"><span class=\"fa fa-plus\"></span></div>\r\n		<div class=\"servicos-icon\"><i class=\"fa fa-mobile\"></i></div>\r\n		<h2 class=\"servicos-title\">Desenvolvimento de Aplicativos</h2>\r\n		<p class=\"servicos-para\">Desenvolvimento de aplicativos para diversas plataformas. aplicativos nativos e híbridos que trazem maior portabilidade para sua empresa</p>\r\n	</div>\r\n	<div class=\"col-xs-12 col-sm-12 col-md-4 col-lg-4 wrapper-overlay\">\r\n		<div class=\"overlay\"><span class=\"fa fa-plus\"></span></div>\r\n		<div class=\"servicos-icon\"><i class=\"fa fa-cart-plus\"></i></div>\r\n		<h2 class=\"servicos-title\">E-Commerce</h2>\r\n		<p class=\"servicos-para\">Trabalhamos com as melhores plataformas do mercado. Uma solução sob medida para comercializar seus produtos no mundo, além de suporte SEO e gerenciamento de E-Commerce.</p>\r\n	</div>\r\n	<div class=\"col-xs-12 col-sm-12 col-md-4 col-lg-4 wrapper-overlay\">\r\n		<div class=\"overlay\"><span class=\"fa fa-plus\"></span></div>\r\n		<div class=\"servicos-icon\"><i class=\"fa fa-database\"></i></div>        \r\n		<h2 class=\"servicos-title\">Gestão, Arquitetura e Balanceamento de Banco de Dados</h2>\r\n		<p class=\"servicos-para\">Ajudamos a definir qual a melhor arquitetura para seu Bando de Dados. Balanceamento, sincronismo, criptografia... Maior confiabilidade para acessar seus dados</p>\r\n	</div>\r\n	<div class=\"col-xs-12 col-sm-12 col-md-4 col-lg-4 wrapper-overlay\">\r\n		<div class=\"overlay\"><span class=\"fa fa-plus\"></span></div>\r\n		<div class=\"servicos-icon\"><i class=\"fa fa-area-chart\"></i></div>\r\n		<h2 class=\"servicos-title\">Consultoria em Serviços Cloud</h2>\r\n		<p class=\"servicos-para\">Definimos qual a melhor relação custo benefício para hospedar seus dados dentro da legislação vigente</p>\r\n	</div>\r\n	<div class=\"col-xs-12 col-sm-12 col-md-4 col-lg-4 wrapper-overlay\">\r\n		<div class=\"overlay\"><span class=\"fa fa-plus\"></span></div>\r\n		<div class=\"servicos-icon\"><i class=\"fa fa-cogs\"></i></div>\r\n		<h2 class=\"servicos-title\">Suporte e Manutenção</h2>\r\n		<p class=\"servicos-para\">Suporte e manutenção personalizado para seus ativos tecnológicos.</p>\r\n	</div>    \r\n	<div class=\"col-xs-12 col-sm-12 col-md-4 col-lg-4 wrapper-overlay\">\r\n		<div class=\"overlay\"><span class=\"fa fa-plus\"></span></div>        \r\n		<div class=\"servicos-icon\"><i class=\"fa fa-bolt\"></i></div>\r\n		<h2 class=\"servicos-title\">Modernização de Sistemas</h2>\r\n		<p class=\"servicos-para\">Precisa atualizar suas ferramentas, deixe nos avaliar.Modernização de sistemas, ferramentas e aplicações com as tecnologias mais atuais e tendências dos próximos anos.</p>\r\n	</div>\r\n	<div class=\"col-xs-12 col-sm-12 col-md-4 col-lg-4 wrapper-overlay\">\r\n		<div class=\"overlay\"><span class=\"fa fa-plus\"></span></div>        \r\n		<div class=\"servicos-icon\"><i class=\"fa fa-handshake-o\"></i></div>\r\n		<h2 class=\"servicos-title\">Programando Um Mundo Melhor</h2>\r\n		<p class=\"servicos-para\">Se você é uma ong ou possui um projeto com a intenção de melhorar o mundo, entre em contato e deixe-nos ajudar.</p>\r\n	</div>\r\n</section>\r\n<!-- Our Work Section -->\r\n<section id=\"projetos\">\r\n	<h1>projetos</h1>\r\n	<div id=\"work\" class=\"page\">\r\n		<div class=\"container\">\r\n		</div>		\r\n	</div>\r\n</section>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";}}}}s:9:\"\0*\0fields\";a:0:{}s:19:\"\0*\0fieldDefinitions\";N;s:12:\"\0*\0languages\";N;s:14:\"\0*\0langcodeKey\";s:8:\"langcode\";s:21:\"\0*\0defaultLangcodeKey\";s:16:\"default_langcode\";s:17:\"\0*\0activeLangcode\";s:9:\"x-default\";s:18:\"\0*\0defaultLangcode\";s:5:\"pt-br\";s:15:\"\0*\0translations\";a:1:{s:9:\"x-default\";a:1:{s:6:\"status\";i:1;}}s:24:\"\0*\0translationInitialize\";b:0;s:14:\"\0*\0newRevision\";b:0;s:20:\"\0*\0isDefaultRevision\";s:1:\"1\";s:13:\"\0*\0entityKeys\";a:4:{s:6:\"bundle\";s:4:\"home\";s:2:\"id\";s:1:\"1\";s:8:\"revision\";s:2:\"44\";s:4:\"uuid\";s:36:\"4e6313ec-3437-4243-961c-40368893bf8c\";}s:25:\"\0*\0translatableEntityKeys\";a:6:{s:5:\"label\";a:1:{s:9:\"x-default\";s:4:\"Home\";}s:8:\"langcode\";a:1:{s:9:\"x-default\";s:5:\"pt-br\";}s:6:\"status\";a:1:{s:9:\"x-default\";s:1:\"1\";}s:9:\"published\";a:1:{s:9:\"x-default\";s:1:\"1\";}s:3:\"uid\";a:1:{s:9:\"x-default\";s:1:\"1\";}s:16:\"default_langcode\";a:1:{s:9:\"x-default\";s:1:\"1\";}}s:12:\"\0*\0validated\";b:0;s:21:\"\0*\0validationRequired\";b:0;s:19:\"\0*\0loadedRevisionId\";s:2:\"44\";s:15:\"\0*\0entityTypeId\";s:4:\"node\";s:15:\"\0*\0enforceIsNew\";N;s:12:\"\0*\0typedData\";N;s:16:\"\0*\0cacheContexts\";a:0:{}s:12:\"\0*\0cacheTags\";a:0:{}s:14:\"\0*\0cacheMaxAge\";i:-1;s:14:\"\0*\0_serviceIds\";a:0:{}}',-1,1508121744.042,1,'entity_field_info node_values','242'),('values:node:10','O:23:\"Drupal\\node\\Entity\\Node\":25:{s:10:\"in_preview\";N;s:9:\"\0*\0values\";a:19:{s:3:\"vid\";a:1:{s:9:\"x-default\";s:2:\"37\";}s:8:\"langcode\";a:1:{s:9:\"x-default\";s:5:\"pt-br\";}s:18:\"revision_timestamp\";a:1:{s:9:\"x-default\";s:10:\"1508106388\";}s:12:\"revision_uid\";a:1:{s:9:\"x-default\";s:1:\"1\";}s:12:\"revision_log\";a:1:{s:9:\"x-default\";N;}s:3:\"nid\";a:1:{s:9:\"x-default\";s:2:\"10\";}s:4:\"typ